  public BeibeiClient() {
  }

  public BeibeiClient(String serverUrl, String appId, String appSecret) {
    super();
    this.serverUrl = serverUrl;
    this.appId = appId;
    this.appSecret = appSecret;
  }
  
  public Map<String, String> getProtocolParams() {
    Map<String, String> protocolParams = new HashMap<String, String>();
    protocolParams.put("method", getMethod());
    protocolParams.put("timestamp", DateTimeTool.getTodayByTimestamp());
    protocolParams.put("app_id", getAppId());
//    protocolParams.put("format", getFormat());

    return protocolParams;
  }
  
  public <T extends BeibeiBaseResponse> T execute(BeibeiBaseRequest<T> request, String sessionKey) throws Exception {
    setMethod(request.getMethod());
    
    Map<String, String> params = new HashMap<String, String>();
    params.putAll(this.getProtocolParams());
    params.putAll(request.getApiParams());
    params.put("session", sessionKey);
    // 生成签名
    params.put("sign", BeibeiUtil.sign(params, this.appSecret, true));
    
    // 调用API
    String result = HttpPostUtils.getInstance().send_common(getServerUrl(), params);

//    System.out.println(result);
    
    T beibeiRsp = null;
    beibeiRsp = JsonUtil.jsonToObject(result, request.getResponseClass());
    beibeiRsp.setResponseBody(result);
    
//    if (beibeiRsp == null) {
//      beibeiRsp = new BeibeiErrorResponse(false, message, responseBody)
//    }
    
    return beibeiRsp;
  }
  
